        <div>
            < img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQYjDy4WLc7eA7wN5rJILV04fX--F7M2SqWeU7mQKPTjvezOguR" />
        </div>

        <MyPosts />

    </div>

    
}

export default Profile;
